SELECT DISTINCT product_id
FROM public.stock_move
WHERE product_id NOT IN (
    SELECT id
    FROM public.product_template
);

select state, count(*) as operation_count 
from public.stock_move 
group by state;

SELECT notification_type, COUNT(*) as user_count
FROM public.res_users
GROUP BY notification_type;

SELECT COUNT(*) AS leads_last_30_days 
FROM crm_lead 
WHERE create_date >= CURRENT_DATE - INTERVAL '30 days';

SELECT id, name, phone_sanitized, email_normalized 
FROM crm_lead 
WHERE phone_sanitized IS NOT NULL AND email_normalized IS NOT NULL;

SELECT name, amount_total 
FROM public.purchase_order 
WHERE amount_total > 5000;

SELECT invoice_status
FROM public.purchase_order
WHERE name = 'P00002';

SELECT name 
FROM purchase_order 
WHERE user_id = 1;

SELECT name 
FROM public.purchase_order 
WHERE dest_address_id IS NULL;

SELECT COUNT(*) 
FROM purchase_order 
WHERE DATE(date_order) = '2025-09-01';

SELECT name, access_token 
FROM purchase_order 
WHERE access_token IS NOT NULL;

SELECT partner_id, COUNT(*) AS total_purchase_orders 
FROM purchase_order 
GROUP BY partner_id;

SELECT name 
FROM purchase_order 
WHERE date_planned > date_order;

SELECT name 
FROM public.purchase_order 
WHERE mail_reminder_confirmed = true OR mail_reception_confirmed = true OR mail_reception_declined = true;

SELECT name 
FROM public.purchase_order 
WHERE date_planned >= '2025-09-04';

SELECT name 
FROM purchase_order 
WHERE currency_id = 1;

SELECT SUM(product_uom_qty) AS total_quantity_ordered 
FROM stock_move 
WHERE product_id = 5;

SELECT id, name 
FROM purchase_order_line 
WHERE state = 'draft';

SELECT id, name 
FROM purchase_order_line 
WHERE discount IS NOT NULL;

SELECT SUM(qty_received) 
FROM purchase_order_line 
WHERE product_id = 6;

SELECT id, name 
FROM public.purchase_order_line
WHERE is_downpayment = true;

SELECT id, name 
FROM purchase_order_line 
WHERE date_planned > '2025-09-03';

SELECT qty_to_invoice 
FROM sale_order_line 
WHERE order_id = 1;

SELECT id, name 
FROM public.purchase_order_line 
WHERE price_tax = 0 OR price_tax IS NULL;

SELECT id, name, display_type 
FROM purchase_order_line 
WHERE display_type IS NOT NULL;

SELECT id, name 
FROM purchase_order_line 
WHERE product_packaging_id IS NULL;

SELECT id, name, product_qty 
FROM purchase_order_line 
WHERE product_qty > 10;

SELECT id, name 
FROM public.purchase_order_line 
WHERE product_uom = 1;

SELECT id, name 
FROM purchase_order_line 
WHERE partner_id = 9;

SELECT id, name 
FROM purchase_order_line 
WHERE date_planned < '2025-09-03';

SELECT id, name, product_packaging_qty 
FROM purchase_order_line 
WHERE product_packaging_qty IS NOT NULL;

SELECT id, name 
FROM purchase_order_line 
WHERE propagate_cancel = true;

SELECT id, name 
FROM purchase_order_line 
WHERE product_id = 33 AND product_qty > 3;

SELECT id, name 
FROM public.purchase_order_line 
WHERE create_date < '2025-09-02';

SELECT id, name, price_subtotal 
FROM purchase_order_line 
WHERE price_subtotal > 1000;

SELECT id, name 
FROM public.purchase_order_line 
WHERE product_qty = 0;

SELECT id, name, sequence 
FROM public.crm_stage 
ORDER BY sequence;

SELECT id, name 
FROM public.crm_stage 
WHERE fold = true;

SELECT id, name 
FROM public.crm_stage 
WHERE write_date > create_date;
